class Items {

    constructor(name, number) {
        this.name = name;
        this.number = number;
        this.completed = false;
    }

    static fromJSON (json) {
        let items = new Items();
        items.id = json.id;
        items.content = json.content;
        items.date = json.date;
        items.completed = json.completed;

        return Items;
    }
}

export default Items;
